import React from "react";
import { View, StyleSheet } from "react-native";
import LocationName from "./LocationName";
import Distance from "./Distance";
import InfoButton from "./InfoButton";
import { restaurantList } from "./src/screens/restaurantsList";

const ResultListContainer = ({ restaurantList }) => {
  return (
    <View>
      <View style={styles.listContainer}>
        <LocationName locationName={restaurantList[0].restaurantName} />
        <Distance distance={restaurantList[0].distance} />
        <InfoButton />
      </View>
      <View style={styles.listContainer}>
        <LocationName locationName={restaurantList[1].restaurantName} />
        <Distance distance={restaurantList[1].distance} />
        <InfoButton />
      </View>
      <MainList restaurantList={restaurantList} />
    </View>
  );
};

const styles = StyleSheet.create({
  listContainer: {
    marginTop: 10,
    backgroundColor: "#232323",
    flexDirection: "row",
    justifyContent: "space-between",
  },
});

export default ResultListContainer;
